INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3001100, "2030/01/01 14:59:59", 2, 2.1, 3001, 1, -416.5, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", "ヤマト", 100, 0.0, "2024/10/31 12:00:00", 130011);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3001101, "2030/01/01 14:59:59", 2, 5.68, 3001, 4, -416.5, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", "ヤマト", 101, 0.0, "2024/10/31 12:00:00", 130011);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3001102, "2030/01/01 14:59:59", 1, 0.0, 3001, 1, -416.5, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", "ヤマト", 102, 0.0, "2024/10/31 12:00:00", 130011);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3002100, "2030/01/01 14:59:59", 1, 0.0, 3002, 1, -416.5, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", "フブキ", 100, 0.0, "2024/10/31 12:00:00", 130211);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3002101, "2030/01/01 14:59:59", 1, 0.0, 3002, 1, -416.5, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", "フブキ", 101, 0.0, "2024/10/31 12:00:00", 130211);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3002102, "2030/01/01 14:59:59", 2, 8.53, 3002, 5, -416.5, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", "フブキ", 102, 0.0, "2024/10/31 12:00:00", 130211);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3002103, "2030/01/01 14:59:59", 1, 5.67, 3002, 7, -416.5, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", "フブキ", 103, 0.0, "2024/10/31 12:00:00", 130211);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3002104, "2030/01/01 14:59:59", 1, 0.0, 3002, 1, -416.5, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", "フブキ", 104, 0.0, "2024/10/31 12:00:00", 130211);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3002300, "2030/01/01 14:59:59", 3, 0.0, 3004, 3, -416.5, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", "フブキ", 300, 0.0, "2024/10/31 12:00:00", 130211);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3002400, "2030/01/01 14:59:59", 7, 0.0, 3005, 7, -416.5, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", "フブキ", 301, 0.0, "2024/10/31 12:00:00", 130211);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3003200, "2030/01/01 14:59:59", 1, 4.4, 3003, 2, -416.5, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", "フブキ", 200, 0.0, "2024/10/31 12:00:00", 130211);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3003201, "2030/01/01 14:59:59", 7, 0.0, 3003, 7, -416.5, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", "フブキ", 201, 0.0, "2024/10/31 12:00:00", 130211);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3003202, "2030/01/01 14:59:59", 2, 5.6, 3003, 1, -416.5, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", "フブキ", 202, 0.0, "2024/10/31 12:00:00", 130211);
